import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import Logo from 'components/Logo';

export default class NavbarLayout extends Component {
  renderLink = (link, path) => {
    return (
      <div key={link.icon}>
        <Link to={link.to}>
          <i
            className={
              'icon fas fa-' +
              link.icon +
              (path === link.to ? ' Highlight' : '')
            }
          ></i>
        </Link>
        {path === link.to && (
          <div
            style={{
              position: 'absolute',
              right: -10,
              top: -1,
              zIndex: 100,
              hover: { color: '#5558EA' },
            }}
          >
            <i
              className="fas fa-circle"
              style={{ fontSize: 6, color: '#5558EA' }}
            ></i>
          </div>
        )}
      </div>
    );
  };

  render() {
    var parts = this.props.location.pathname.split('/');
    var path = '/' + parts[1] + (parts[2] ? '/' + parts[2] : '');
    var links = [
      // {to: "/app", icon: "home", tooltip: "homepage"},
      { to: '/app/settings', icon: 'cog', space: true, tooltip: 'settings' },
    ];

    return (
      <div>
        <div className={'Navbar'}>
          <Logo />
          <div />
          <div style={{ height: 25 }} />
          {links.map(link => {
            return this.renderLink(link, path);
          })}
          <div onClick={this.props.logoutUser} style={{ cursor: 'pointer' }}>
            <i className="icon fas fa-sign-out-alt"></i>
          </div>
        </div>
        <div className={'NavbarContent'}>{this.props.children}</div>
      </div>
    );
  }
}
